import React from "react";
import { Switch, Route } from "react-router-dom";
import Anasayfa from "./components/Anasayfa/Anasayfa";
import SiparisFormu from "./components/SiparisFormu/SiparisFormu";
import SiparisOnay from "./components/SiparisOnayı/SiparisOnay";

const App = () => {

  return (

        <Switch>

          <Route exact path="/">
            <Anasayfa />
          </Route>

          <Route path="/pizza">
            <SiparisFormu />
          </Route>

          <Route path="/success">
            <SiparisOnay />
          </Route>

        </Switch>

  );
};

export default App;
